import React from 'react';

const NavLink = [
    {
        title: 'HOME',
        path:'/'
    },
    {
        title: 'PRODUCTS',
        path:'/products'
    },
    {
        title: 'BRANDS',
        path:'/brands'
    },
    {
        title: 'SIGNIN',
        path:'/sign-in'
    },
    {
        title: 'SIGNUP',
        path:'/sign-up'
    }
]

function Navigation() {
    return(
        <nav className="site-navigation">
            <span>Cubiz Store</span>
            <ul>
                <li></li>
            </ul>
        </nav>
    )
}

export default Navigation;
